import React, { Component } from "react";

class SubTotal extends Component {
  render() {
    let subtotal = this.props.items;
    return (
      <div className="cart__subtotal">
        <span>SUBTOTAL</span>
        <span>$ {this.props.subtotal}</span>
      </div>
    );
  }
}

export default SubTotal;
